            font-size: inherit
        }

        [class*=btn-],
        a[class*=btn-] {
            cursor: pointer;
            text-align: center;
            border-radius: 3px;
            padding: 15px 30px;
            background-color: #fff;
            background-image: -webkit-linear-gradient(#fff, #f6f6f6);
            background-image: linear-gradient(#fff, #f6f6f6);
            color: #424242;
            border: 1px solid #dcdfe0;
            border-bottom: solid 2px #dcdfe0
        }

        .btn-primary,
        a.btn-primary {
            color: #fff;
            background-color: #1da35f;
            background-image: -webkit-linear-gradient(#1da35f, #1b9a5a);
            background-image: linear-gradient(#1da35f, #1b9a5a);
            border-color: #188950;
            display: inline-block
        }

        .btn-primary:not([disabled]):hover {
            background-color: #197647;
            background-image: -webkit-linear-gradient(#197647, #248e59);
            background-image: linear-gradient(#197647, #248e59)
        }

        .btn-secondary,
        a.btn-secondary {
            border: 1px solid #dbdbdb;
            border-bottom: solid 2px #dbdbdb;
            background-color: #fff;
            background-image: -webkit-linear-gradient(#fff, #f6f6f6);
            background-image: linear-gradient(#fff, #f6f6f6)
        }

        .btn-secondary#btn-modifier-numero,
        a.btn-secondary#btn-modifier-numero {
            margin-right: 10px
        }

