            padding: 6px 1rem 6px .8rem;
            background-color: #9d265c;
            background-image: none;
            color: #fff;
            line-height: 1.45rem;
            border-color: #9d265c
        }

        a.btn-help .icon-info {
            font-size: 1.45rem;
            padding-right: 6px;
            vertical-align: middle
        }

        .btn-third {
            padding: 0 20px
        }

        .btn-secondary:not([disabled]):hover,
        .btn-third.active,
