            background-color: #f6f6f6;
            background-image: -webkit-linear-gradient(#f6f6f6, #fff);
            background-image: linear-gradient(#f6f6f6, #fff)
        }

        .button-filter {
            padding: 11px 29px 11px 29px;
            position: relative
        }

        .button-filter.active:before {
            background-position: -9px -364px;
            content: "";
            background-image:
                /*savepage-url=/rsc/contrib/image/generique/sprite-form.png*/
                var(--savepage-url-46);
            height: 17px;
            width: 30px;
            top: 12px;
            left: -2px;
            padding-right: 5px;
            padding-top: 5px;
            position: absolute
        }

        .btn-block {
            width: 100%;
            display: block
        }

        .btn-.disabled,
        .btn-secondary.disable {
            cursor: default;
            opacity: .5
        }

        .btn-.disabled:hover,
        .btn-secondary.disable:hover {
            background-color: #fff;
            background-image: -webkit-linear-gradient(#fff, #f6f6f6);
            background-image: linear-gradient(#fff, #f6f6f6)
        }

        .btn-primary.inactive,
        .btn-primary:disabled,
        .btn-secondary.inactive,
        .btn-secondary:disabled {
            background-image: none;
            opacity: .3
        }

