        .arrow-bottom,
        .arrow-left,
        .arrow-right,
        .arrow-top {
            position: relative
        }

        .arrow-bottom:after,
        .arrow-left:after,
        .arrow-right:after,
        .arrow-top:after {
            position: absolute;
            content: " ";
            display: block;
            pointer-events: none;
            border-style: solid;
            width: 0;
            height: 0;
            border-color: transparent
        }

        .arrow-bottom:after {
            border-width: 10px 10px 0 10px;
            left: 50%;
            margin-left: -10px;
            bottom: -10px
        }

        .arrow-top:after {
            border-width: 0 10px 10px 10px;
            left: 50%;
            margin-left: -10px;
            top: -10px
        }

        .arrow-left:after {
            border-width: 10px 10px 10px 0;
            right: 100%;
            top: 50%;
            margin-top: -10px;
            border-right-color: #f8f8f8
        }

        .arrow-right:after {
            border-width: 10px 0 10px 10px;
            left: 100%;
            top: 50%;
            border-left-color: #f8f8f8;
            margin-top: -10px
        }

