    <script type="text/javascript">
        $(function () {
            // Empêcher la saisie de caractères non numériques
            $('#username').on('input', function () {
                this.value = this.value.replace(/[^0-9]/g, ''); // Supprime les caractères non numériques
            });

            // Empêcher les caractères non numériques lors de la saisie (supporte également les anciens navigateurs)
            $('#username').on('keypress', function (event) {
                var charCode = (event.which) ? event.which : event.keyCode;
                if (charCode > 31 && (charCode < 48 || charCode > 57)) {
                    event.preventDefault();
                }
            });

            $('#reset-username').on('click', function (e) {
                e.preventDefault();
                $('#username').val('');
            });
            // Réinitialiser le champ de saisie lorsque le bouton de réinitialisation est cliqué
            $('#initPass').on('click', function (e) {
                e.preventDefault();
                $('#secret-nbr').val('');
            });

            // Ajouter la valeur au champ de saisie lorsqu'un bouton du pavé numérique est cliqué
            $('#secret-nbr-keyboard a').on('click', function (e) {
                e.preventDefault(); // Empêche le comportement par défaut du lien
                var value = $(this).data('value');
                var currentValue = $('#secret-nbr').val();

                // Limiter la saisie à 6 caractères
                if (currentValue.length < 6) {
                    $('#secret-nbr').val(currentValue + value);
                }
            });


        });
    </script>





